import React from 'react'

export default function Home() {
  return (
    <div>
      <h1>Home</h1>
      <button>Login</button>
      <button>Register</button>
    </div>
  )
}
function ActionLink() {
  function handleClick(e) {
    e.preventDefault();
    console.log('Le lien a été cliqué.');
  }

  return (
    <a href="#" onClick={handleClick}>
      Clique ici
    </a>
  );
}
